{"nlp_api": {"black_and_white_list": [], "documents": [{"id": "cbaf45bfdb064a1c95eac138d6e8f80b", "content": "台美關係怎處理？韓竟回「處理好就沒關係」？李正皓：我都想翻白眼！-【關鍵精華】劉寶傑 @翁老大<BR>你知道嗎？1994年，陳水扁競選連任台北市市長時，他的施政滿意度是多少嗎？答案是76%，卻輸給了馬英九。這是為什麼呢？<BR>陳菊離開高雄市時，他的施政滿意度，又是多少呢？那為何接班人陳其邁會輸得那麼難看?<BR>柯文哲做事不認真嗎？<BR>如果柯文哲做事不認真，從2017年，世大運後，所有傳統偏藍偏綠媒體，無所不用其極的攻擊柯文哲，抹黑.抹紅之外，更幾乎看不到柯市府團體的施政結果。2018年，更是藍綠連手，硬要把柯文哲拉下來。<BR>就算是如此，柯文哲一樣工作到法定的時間，投票前15天，才請假，全力以赴的投入選舉。雖然險勝，但還是勝選!<BR>你以施政民調，用\"?\"來批柯文哲的工作態度。<BR>鄭文燦的民調夠高了！但是，你知道鄭文燦當桃園市市長5年來，桃園市的財務變化嗎？相信你不會想要去了解的，因為立場，因為政治信仰。<BR>國民黨從李登輝之後，開始爛，但是，至少國民黨人要貪污，還知道要，先設計要花錢的項目標的，再來編預算，再來找財團。<BR>民進黨呢？比國民黨更無恥。在毫無計畫項目下，蔡英文先來個8年8800億預算案，然後，在立法院民進黨跟國民黨演一場爛戲，達成4年4400億的預算案，如果再加上地方政府的自籌款，是超過6000億的錢。馬英九雖然無能，國民黨官雖然爛，但是，至少先編了個愛台12項建設。<BR>宋楚瑜是台灣的末代省長，他的施政及民調也很高，做事也算認真，可是，台灣目前公認的蚊子館，有多少是宋省長時期撥款的!?<BR>你以為藍綠政客，在2018年連手，尤其是民進黨，要把柯文哲這個台北市市長拉下來，真的是如民進黨政客.綠色媒體所說的，因為政治思想的嗎？<BR>真的如國民黨人.偏藍媒體說的，柯文哲毫無政績嗎？<BR>2014~18年，台北市都發局長林洲民領導的都發局的規劃下，台北市的願景，在未來十年內，台北市可能招標的金額是以千億計，單單就以，被民進黨政客先拖再擋的雙子星，就600+億了！<BR>要拉下柯文哲，就只是因為，柯文哲工作太認真，擋住了太多無恥藍綠政客的不當利益。<BR>藍綠政客要拉下柯文哲，說到底，就是為了錢。為了不當利益!<BR>有立場!有政治信仰!沒有錯! <BR>有錯的是，有了立場，有了政治信仰以後，就沒有是非.對錯.黑白.事實求是。<BR>如果你是支持國民黨，就去看看李登輝時期.馬英九時期.現在此時，國民黨的變化。<BR>同樣的，如果是支持民進黨的，去了解一下，黨外時期+民進黨早期是什麼樣的民進黨人。陳水扁當總統8年，民進黨又是如何的變化，看看蔡英文四年來的全面執政，又做了那些事了？民進黨在新潮流的主導下，又變成什麼樣了？<BR>有立場，有政治信仰，是沒有錯的!<BR>但是<BR>沒有是非.對錯.黑白.事實求是，就錯了！"}], "powerterm": true, "summarizer": false}}
