{"nlp_api": {"black_and_white_list": [], "documents": [{"id": "3423378371624b0b8bcab159154ed531", "content": "今天，我要向高雄的朋友介紹台灣民眾黨高雄三民、苓雅的立委候選人：「小辣椒」李... 轉貼：吹噓出來的光榮城市不愧是歷任台北市長滿意度倒數第二的柯文哲，馬娘娘都屌打你柯文哲總說：不談統獨只談國家治理。但現實是，台北市在柯文哲市長治理下，短短五年已經流失9.3萬人口，爆發最大的人口流失潮。光是今年前十月，台北市的淨移出人口更就逼近2.5萬人，不但是18年來新高，也是今年六都唯一人口負成長。年輕人，正在逃離台北。污染的空氣、高漲的房價、擁擠的交通、社會福利越來越差，拿了別的縣市幾乎兩倍的人均統籌分配款，這個市長過去五年幾乎一事無成，高喊居住正義，卻沒有辦法讓年輕人有能力留在台北生活。預計幾年內，桃園市的人口就會超過台北市。城市都治理不好，談什麼國家治理？一個沒有政績、整天嘴砲，騙年輕人選票的無能政客，還能在政壇上走多久？"}], "powerterm": true, "summarizer": false}}
