{"nlp_api": {"black_and_white_list": [], "documents": [{"id": "78a47481e66e414c8a3d0dc371733162", "content": "【台灣向前行】蓋堤防圈地國土變私用？疑助濫採砂國昌批說謊！2019.11.30(上) 韓國瑜只會說著\"高雄發大財\"、\"征服宇宙\"，典型只是個吹牛皮的草包。支持這種草包是一群盲目的選民。議會質詢韓國瑜越多，草包出醜笑話就越多！愚蠢高雄市民目前苦哈哈，高雄未發大財，唯有韓禿(選舉)發大財笑哈哈！(選舉補助金:2677.6萬元)，韓禿選舉靠一碗滷肉飯一瓶礦泉水根本騙人的！花費超過上億元選舉經費是六都最高，透過潘恆旭作假帳暗槓政治獻金。<BR> <BR>國民黨自己都批評李登輝黑金政治，90年代當時李登輝為了制衡國民黨的派系鬥爭，在1992年的立委選舉中把各地的黑金勢力都找來選立委，\"曾振農\"、\"郭廷才\"、\"林明義\"、\"廖福本\"、\"廖泉裕\"還有\"韓國瑜\"，都是同一批進立院，現在除了\"韓國瑜\"尚存外，其他人由於年紀漸大，因病都已死亡，大家可能已經漸漸不熟悉了，問年紀約55歲以上有在關註政治的人，應該依稀都還記的這些\"大咖\"，簡單總結：他們都是黑道底出身的。<BR> <BR>在1990年11月16日，韓國瑜在縣議會裡就毆打過台北縣長尤清。韓國瑜行事針對本省籍民意代表，激化起本省籍及外省籍的對立，引發中和眷村\"壽德新村\"省籍械鬥。<BR><BR>過去剛進立院1993年5月5日就把蘇煥智和陳水扁「打到進醫院」，但當時陳水扁是在幫\"榮胞\"爭取權益(生活費)，出身眷村的韓國瑜卻還搞不清楚，陳水扁在幫\"榮胞\"爭取經費，說這樣的經費是在養豬嗎？韓國瑜卻咬陳水扁說\"養豬\"侮辱榮民，真是烏龍腦殘而打扁(\"榮胞\"是1949年未隨政府遷台，稍後才從泰緬或港澳來台的國軍傷殘官兵。\"榮民\"則是指1961年6月30日之後退伍享有榮民待遇的退除役官兵)。陳水扁因常揭國民黨軍系弊端，早就讓韓國瑜恨的牙癢癢，隨時動不動就是要硬挑事端，這種不問政事只想用暴力修理對手，是當時國民黨黑道治國時期立法院的頭號打手，用暴力來壓制民進黨的問政，打陳水扁隔天更找來天道盟、四海、竹聯到立院助陣。韓國瑜黑道背景立委至今很難脫身，如今想漂白暗黑的過往，曾經走過必留下痕跡。<BR> <BR>1993年9月2日，韓國瑜擔任立委期間，協助槍擊案兇嫌天道盟黑道大哥許天德，帶著人頭小弟王朝貫，前往大同分局投案替開槍的許天德頂罪。後來許天德在議員造勢場合展示沖鋒槍，警方發現不對勁進行監聽才獲知真正案情。害當時4員警全被停職吃上官司，韓國瑜25年後出面輕描淡寫，只是選民服務受人之託(專為黑道大哥脫罪，專為黑道服務吧！)<BR> <BR>告訴大家很早就會使出奧步的人就是韓國瑜，2007年4月22日國民黨立委黨內初選競爭激烈，立委李慶華當日出面指控同選區的競爭對手、時任中和市副市長的\"韓國瑜\"製造負面文宣攻擊李慶華，立委李慶華表示這樣的負面文宣，根本就是選風敗壞，經馬英九的同意，台北縣黨部緊急通知取消韓國瑜的立委參選資格。<BR><BR>知道為何他過去當立委被選評為最後一名？(因太會打混了)因在立委會期間幾乎沒甚麽提案及質詢，韓自己也從25年前擔任立委就身體力行打混，在1993~2002年擔任立法委員，近十年間的質詢發言率極低，甚至有四個會期掛蛋、完全沒有質詢。其中1999年12月23日到2000年11月9日，長達近一年沒在所屬委員會質詢發言。連自家國民黨都看不過去而邊緣他。一直到今天國民黨高層們還是看不起他這草包。只要了解韓草包過去，沒人會相信他。<BR><BR>後來馬英九就不讓韓禿代表國民黨選立法委員(韓禿就是個發跡眷村與黑道掛勾暴力土流氓)，韓禿記恨\"馬\"到今天，現在韓禿又說謊是自己不選立委。<BR> <BR>韓國瑜的岳父李日貴是濁水溪的砂石業者(在台灣大都是地方土霸、黑道流氓把持，違法超挖，挖得滿缽金山銀山)，曾三連任雲林縣議員，與蘇文雄都是\"廖泉裕\"人馬。廖泉裕派系原與張榮味不合，還在1994年的雲林議員選舉，廖泉裕率領李日貴、林明義一起罵張榮味。不過應該是金錢力量大，議員選後李日貴馬上就收賄支持張榮味擔任議長。此案整整纏訟11年，才在2005年3月10日判決定讞，張榮味獲判1年有期徒刑、李日貴等收賄的議員們各判7個月。因此在1997年的縣長選舉，李日貴與韓國瑜都支持自家人蘇文雄，只是蘇文雄在1999年縣長任內病故後，大大影響了韓與李的此派系在雲林的政治版圖，韓國瑜家族也就被張榮味的金錢及利益收編了。<BR><BR>韓國瑜後來成為張榮味派系的一員，被張派到台北農產當總經理。雲林縣多年在台灣人的印象就是流氓黑道橫行的地方，其實一點也沒錯，黑道治縣治鄉，除了以前屏東縣(議長鄭太吉)，另一就是雲林縣，雲林縣張派也把持當地政治也把持農漁畜農會水利會等。台北市長柯文哲就曾脫口說：張榮味，他不是黑道的嗎？(張以前鎮長選輸還跑去對手總部開槍，如說張榮味不是黑道，雲林人會笑死)，張榮味妹妹張麗善此次參選雲林縣長，就揚言要告柯文哲，這些人都不承認自己是黑道(韓國瑜也是說，如果有人查到他有加入幫派，他就退選。台灣一些大黑金惡勢力，哪一個有幫派名稱？除了以前\"羅福助\"有天道盟幫派，其他的幾乎是自己名字就是幫派派系。)<BR> <BR>因和韓國瑜同樣去就讀的台灣人也好幾個啊！韓禿是個投機分子，充滿謊言只為騙票！國民黨高層都是講究高等學歷，韓禿草根習氣在黨內混不出名堂的，於是2001~2009年，韓在大陸北京大學政府管理學院(專供共慘黨高官用來鍍金學歷及黨官訓練)，修博士學位，並於2009年畢業，畢業生名單就有韓，還包括了台灣學者劉坤鱧、前高雄市議員王齡嬌等人(以及已故的台中市議員王蘊嶠)，所以事實終究無法掩蓋的。韓禿上媒體都避談國民黨不讓其選立委後期間的事，只說一個人過著隱士般生活，淡化此段時間他在大陸做甚麽？也不談及大陸念書的事。<BR><BR>跟他同屆博士班畢業的還有新聞鬧很大，今年九月回中國而「被失蹤」的國際刑警組織主席\"孟宏偉\"。 <BR>韓禿北大生涯遭爆\"夜夜笙歌\"！張宇韶嗆：有沒有去過\"天元俱樂部\"、\"台灣會館\"花天酒地？許多台商、資深媒體人在此兩家店消費時都看過韓國瑜。<BR><BR>發行的\"北大青年\"有詳載(2009年7月11日農曆5月19日星期六，北京大學2009屆畢業生名單博士畢業生)基進黨高雄市議員候選人李雨蓁、陳信諭已將此\"北大特刊\"公佈。畢竟共產黨主子會挺韓禿，如果幫你出個假證明，說韓國瑜念了8年博士一事無成，連混個肄業都沒有，好像也不怎麽光彩！<BR> <BR>\"韓為何再三掩飾，說未拿到學位，也沒有北京大學肄業的身份\"。韓的動機令人懷疑？ <BR>台灣也有不少從政者包括民進黨員，也有到大陸修讀博士，但他們也沒隱瞞，是因本身服務的客戶工作涉及法律，必須對大陸法律有進一步暸解。學歷台灣不承認他們也不在乎。所以心裡坦蕩也不怕人家知道，就是有心人要抹紅也不怕，會耐心加以解說，但不會刻意逃避及說謊。<BR><BR>韓的這種作為，說了謊必須用更大的謊言來圓謊，或虛張聲勢說別人抹紅造謠，要告人要法律途徑解決，更讓人懷疑？若要人不知，除非己莫為。修個文科博士為何要搞個8年多？<BR><BR>難免台灣人在政治上會聯想到是否與共慘黨有其他不可告人...。 <BR>韓根本作秀，如果提告或許8年在中國大陸到底有甚麽不想讓人知道的事，將一一掀鍋攤在陽光下。 <BR>表裡不一靠一張嘴就想行騙天下，滿嘴\"包容與愛\"，其實是投機取巧不敢告！ <BR>真金才不怕火煉，就是刻意淡化或說謊，也不會降低別人對你的疑慮，只會讓你失分更多！ <BR>韓禿最後競逐國民黨主席，將本土國民黨員剔除(吳，王，朱)，進而遂行共產黨兵不血刃赤化國民黨目的，再聯合新黨及捅畜黨、愛國同心會(統派共慘黨同夥)，成為台灣最大黨，台灣就在共慘黨的掌握中了。<BR> <BR>台灣仍很多群眾，都被親共舔共媒體如中天、中時、東森、TVBS..等等..，漫天漫海不斷播送吹捧塑造韓神的影片所欺騙及其不實妖言所迷惑。(連網紅\"館長\"都曾眼瞎懊悔幫忙造勢助推讓其選上市長。)<BR> <BR>這些認同有問題的媒體，他們如喜歡當共慘黨奴民，應該搬回去他們認同的祖國--共慘國。 <BR>台灣媒體大多被藍營統派節目充斥了，台灣的新聞龍捲風、夜問打權和關鍵時刻、旺旺、中天、中視、中時、東森、TVBS、工商時報、經濟日報、時報周刊、周刊王、中國時報、聯合報、少康戰情室、飛碟電台，...，這些台灣政論節目大多變成中共買下的中資節目，中共在背後揖助資金在支持，都被共慘黨收買而\"藍金黃\"了。<BR><BR>除了天天詆毀台灣政府，吹捧共慘祖國及習近平的好及共慘國的進步強盛。在台灣電視及網路媒體上漫天漫海，每天不斷放送吹捧塑造韓神，台灣有不少人被這些親共媒體忽悠了。中共共慘國亂象一大堆，中國人民都愛自由民主有言論自由的台灣，中國人民不愛共慘國，台灣國民黨統派愛當中共的奴民，可以來跟中共人民交換，讓你們來做大一統的濺民奴民！<BR>國民黨親共統派媒體參與\"兩岸媒體人北京峰會\"。https://youtu.be/lVWUh2SXpAA"}], "powerterm": true, "summarizer": false}}
