{"nlp_api": {"black_and_white_list": [], "documents": [{"id": "0f3c81fe11e04a759d4ba2fc313a97c2", "content": "郭台銘拋出國會「兩大兩小」柯文哲意有所指這樣說...－民視新聞 【#民視快新聞】鴻海集團創辦人郭台銘拋出國會「兩大兩小」，不禁讓外界聯想他「腳踏兩條船」的疑慮。台北市長柯文哲今（1）日面對這個問題時，他意有所指的說，郭台銘是站在自己的立場「兩邊都支持」，他強調「台灣重開機，才是歷史轉折的重要關鍵」。"}], "powerterm": true, "summarizer": false}}
{"nlp_api": {"black_and_white_list": [], "documents": [{"id": "9106c2f3f07c4c19af41f6e7820c2ac2", "content": "郭台銘拋國會「2大2小」柯文哲喊「3黨不過半」－民視新聞 對抗共產黨唯一的辦法是，讓民進黨及綠營國會過四分之三，用修憲來嵌制紅色勢力的發展，這是最後的希望了。<BR>別忘了宋楚瑜也盡了中聯辦，柯文哲沒有核心價值，投機份子，兩人都沒有堅定的護台主張，也都不反共，他們不是武統不是急統，而是緩統派，最終還是會讓中華民國國旗國歌國軍國家消失的人。"}], "powerterm": true, "summarizer": false}}
