{"nlp_api": {"black_and_white_list": [], "documents": [{"id": "1487c4d10c73486cbe6980e3347c948c", "content": "郭台銘拋國會「兩大兩小」柯文哲：台灣重開機【最新快訊】 神棍157現在蹭的是大金牛郭董的郭家軍、新光公主吳欣盈、醫療集團二代楊弘仁，你海外台灣人什麼咖啊，螞蟻？都是「騙子、不要臉、瞧不起你～」ㄏㄏ <BR> <BR>民眾黨不分區第十二名的楊弘仁，楊的父親為前中國國民黨桃園市黨部主委楊敏盛，並在今年4月曾接受《中國評論通訊社》採訪表示，「承認一中，一國兩治是最簡單而有效的處方」、「台灣是中國的一部分，誰都不能否認」。 <BR> <BR>柯文哲表示：「郭台銘是大金牛，兩個有得拚了」（2019.06.17 <BR>記者問，若蔡郭是大金牛，自己是甚麼？柯則表示，「我不曉得，螞蟻吧！"}], "powerterm": true, "summarizer": false}}
