{"nlp_api": {"black_and_white_list": [], "documents": [{"id": "563fff0450f24331be9a5b18a5b693c9", "content": "今天，我要向高雄的朋友介紹台灣民眾黨高雄三民、苓雅的立委候選人：「小辣椒」李... 【總統+立委過半=獨裁】總統初選黨員直選要像總統大選一樣，要像高普考一樣公開公平公正……台灣民主因少數政客的私心私利政黨私有化無法走出民主的瓶頸，民主原地踏步20年，藍綠惡鬥20年，經濟與薪資原地踏步20年，總統兼黨主席以立法委員政黨提名權的實質影響力掌控立法權，而司法院長、檢察總長、大法官,都是總統提名,立法院同意,形成總統提名總統同意,妨害司法權獨立與制衡，違憲【違反憲法本文與違反憲法原理原則都是違憲】……司法權由總統提名總統同意造成以前檢察總長向總統洩密案、辦藍不辦綠或辦綠不辦藍、大法官釋憲變成總統的擧手部隊，總統掌控行政、立法、司法是獨裁而非民主，這樣違憲的民主制度產生民選的獨裁總統，比美國總統川普權力還大，還沾沾自喜到處宣揚，2020用選票找回民主落實憲政……民國初年軍隊私有化造成軍閥專政，民國108年政黨私有化造成黨閥專政，真的革命尚未成功，同志仍須努力。"}], "powerterm": true, "summarizer": false}}
